using System.Net;
using System.Net.Http;
using System.Net.Mail;

int diaMelhorData = 31;

// Obter a data atual
DateTime dataAtual = DateTime.Now;


// Calcular o próximo mês
DateTime proximoMes = dataAtual.AddMonths(1);

// Verificar se o diaMelhorData é maior do que o último dia do próximo mês
if (diaMelhorData > DateTime.DaysInMonth(proximoMes.Year, proximoMes.Month))
{
    Console.WriteLine("Insira uma data válida");

} else {
    // Criar a data para melhorData com base no próximo mês e diaMelhorData
    DateTime melhorData = new DateTime(proximoMes.Year, proximoMes.Month, diaMelhorData);

    // Formatar as datas
    string dataFormatada = dataAtual.ToString("dd/MM/yyyy");
    string melhorDataFormatada = melhorData.ToString("dd/MM/yyyy");

    Console.WriteLine(dataFormatada);
    Console.WriteLine("--------------");
    Console.WriteLine(melhorDataFormatada);
}

// Sua string base64 do arquivo PDF
string base64String = "";

// Decodifica a string base64 para obter os dados binários
byte[] pdfData = Convert.FromBase64String(base64String);

// Caminho onde você deseja salvar o arquivo PDF
string outputPath = "caminho_para_o_arquivo.pdf";

// Salva os dados binários em um arquivo PDF
File.WriteAllBytes(outputPath, pdfData);

Console.WriteLine("Arquivo PDF foi criado com sucesso em: " + outputPath);

